import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  var user = JSON.parse(localStorage.getItem("currentUser"));
  return (
    <>
      <h1>{user.name}</h1>
      <nav>
        <ul>
          <li>
            <Link to="/Layout/Posts">Posts</Link>
          </li>
          <li>
            <Link to="/Layout/Todos">Todos</Link>
          </li>
          <li>
            <Link to="/Layout/Logout">Logout</Link>
          </li>
          <li>
            <Link to="/Layout/Albums">Albums</Link>
          </li>
          <li>
            <Link to="/Layout/Info">Info</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
  );
};

export default Layout;
